                  "reduce_script": "def diff = null;for (responses in states) {diff = responses['stop'] - responses['start'];}return diff;"
                }
              }
            }
          }
        },
        "size": 0,
        "query": {
          "bool": {
            "must": [],
            "filter": [
              {"match_all": {}},
              {"match_phrase": {"value.bpmnProcessId": "mpesa-flow-v3-oaf"}},
              {"match_phrase": {"value.processInstanceKey": "2251799817833262"}}
            ],
            "should": [],
            "must_not": [
              {"wildcard": {"value.elementId": "*Flow*"}},
              {"wildcard": {"value.elementId": "*Gateway*"}},
              {"wildcard": {"value.elementId": "*Event*"}},
              {"wildcard": {"value.elementId": "*mpesa*"}}
            ]
          }
        }
      }
    },
    "format": {"property": "aggregations.categories.buckets"}
  },
  "mark": "bar",
  "encoding": {
    "x": {
      "field": "duration.value",
      "type": "temporal",
      "timeUnit": "seconds",
      "axis": {"title": "Time taken in seconds "}
    },
    "y": {"field": "key", "type": "nominal", "axis": {"title": "Tasks"}},
    "color": {"field": "key", "type": "nominal"}
  },
  "layer": [
    {
      "mark": "rect",
      "encoding": {
        "color": {
          "field": "duration.value",
          "type": "temporal",
          "timeUnit": "seconds",
          "title": "Time elapsed",
          "legend": {"direction": "horizontal", "gradientLength": 120}
        }
      }
    }
  ]
}"}}

