                }
              }
            }
          }
        }
        size: 0
        query: {
          bool: {
            must: [
            ]
            filter: [
              {
                match_all: {
                }
              }
              {
                match_phrase: {
                  value.bpmnProcessId: mpesa-flow-v3
                }
              }
            ]
            should: [
            ]
            must_not: [
            ]
          }
        }
      }
    }
    format: {
      property: aggregations.categories.buckets
    }
  }
  transform: [
    {
      calculate: "datum['duration.value'] > 120000 ? 'above 2 min' : 'below 2 min' "
